import React from 'react';
import triumph from '../../assets/logo.001.beige.PNG';
import "./footer.css";

const churchName = "Triumph Seventh-Day Adventist Chruch";
const address = "307 butte ave S";
const cityStateZip = "Auburn WA 98047";
const phoneNumber = "253 951 0250";

export default function Footer() {
  return (
    <>
        <div className='footer'>
            <div className='logoContainer2'>
                <img className='triumphLogo2' src={triumph} alt="" />

            </div>
            <div className='footerDesc'>
                {churchName}
                {address}
                {cityStateZip}
                {phoneNumber}
            </div>
            <div className="created">
                Copyright Triumph Adventist Chruch
            </div>
        </div>
    </>

  )
}
